import React from "react";
import PokeList from "./PokeList.js";
import Pokemon from "./pokemon.js";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = { pokemons };
  }

  render() {
    return (
      <div className="App">
        <PokeList pokemons={this.state.pokemons} />
      </div>
    );
  }
}

export default App;
